import React from 'react';
import Form_LUDecomposition from '../Components_Linear/Form_LUDecomposition';

function LUDecomposition() {
    return (
        <div>
            <h1>LU Decomposition</h1>
            <Form_LUDecomposition />
        </div>
    );
}

export default LUDecomposition;
